import React from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import SvgIcon from '@mui/material/SvgIcon';

// Reemplaza esto con la ruta correcta a tu logo
import YourLogo from 'images/logo.png';

const headerHeight = '64px';

const HeaderApp = () => {
  return (
    <AppBar position="static" style={{ backgroundColor: 'white', color: '#222223', minHeight: headerHeight, zIndex: '1000' }}>
      <Toolbar>
        {/* Aquí reemplazamos el MenuIcon con el logo de la aplicación */}
        <IconButton edge="start" color="inherit" aria-label="menu">
          {/* Puedes importar tu logo como un componente de SVG y usarlo aquí */}
          <img src="images/logo.png" alt="Logo" style={{ width: '43%', alignSelf: 'flex-start', marginRight: '135px', marginTop: '10px' }} />

        </IconButton>

        {/* Asumiendo que quieres mantener el espacio entre el logo y los iconos a la derecha */}
        <div style={{ flexGrow: 1 }} />

        {/* Aquí se colocarán los iconos adicionales como en tu diseño */}
        <IconButton color="inherit">
          {/* Icono 1 - reemplaza SvgIcon con el icono específico que desees */}
          <SvgIcon>
            {/* Puedes poner el path del SVG aquí */}
          </SvgIcon>
        </IconButton>
        <IconButton color="inherit">
          {/* Icono 2 - reemplaza SvgIcon con el icono específico que desees */}
          <SvgIcon>
            {/* Puedes poner el path del SVG aquí */}
          </SvgIcon>
        </IconButton>
        {/* Añade más IconButton aquí si es necesario */}

        {/* Icono de perfil del usuario */}
        <IconButton color="inherit">
          {/* Usa AccountCircle o importa un SVG personalizado si es necesario */}
          <AccountCircle />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
};

export default HeaderApp;
